import './App.css';
import NavBar from './components/NavBar';

import React, { Component } from 'react'
import News from './components/News';
import {
  BrowserRouter as Router,
  Route,
} from "react-router-dom";

export default class App extends Component {
  render() {
    return (
      <>
        <Router>
          <div>
            <NavBar />
            <h2>Top News</h2>
              <Route path="/Business" element={<News cat='business' country='in' />} />
              <Route path="/Entertainment" element={<News cat='entertainment' country='in' />} />
              <Route path="/" element={<News cat='general' country='in' />} />
              <Route path="/General" element={<News cat='general' country='in' />} />
              <Route path="/Health" element={<News cat='health' country='in' />} />
              <Route path="/Sports" element={<News cat='sports' country='in' />} />
              <Route path="/Science" element={<News cat='science' country='in' />} />
              <Route path="/Technology" element={<News cat='technology' country='in' />} />
          </div>
        </Router>
      </>
    )
  }
}
